Now, we will write a function to calculate the sha256 hash of our balance. We need it to verify the balance stored within the leaf node at our Merkle tree path. fn balance_hash(balance: field) -> Sha256Digest { let bits = std::convert::to_bits(balance); // [bool; 254] let bits_padded = std::array::pad(bits, 256, false); // [bool; 256] std::crypto::sha256(bits_padded) // [bool; 256] a.k.a. Sha256Digest
} The function accepts balance we passed as secret witness data, converts it into a bit array of length 254 (elliptic curve field length), and pads the array with 2 extra zero bits, since we are going to pass 256 bit vector to the sha256 function. We have also used here three functions from the Zinc standard library from three different modules. The std::crypto::sha256-like paths might seem a bit verbose, but we will solve this problem later. At this stage, this is how our code looks like: type Sha256Digest = [bool; 256]; struct PublicInput { root_hash: Sha256Digest,
} fn balance_hash(balance: field) -> Sha256Digest { let bits = std::convert::to_bits(balance); // [bool; 254] let bits_padded = std::array::pad(bits, 256, false); // [bool; 256] std::crypto::sha256(bits_padded) // [bool; 256] a.k.a. Sha256Digest
} fn main( address: [bool; 10], // the node address in the merkle tree balance: field, // the balance stored in the node merkle_path: [Sha256Digest; 10] // the hash path to the node
) -> PublicInput { let leaf_hash = balance_hash(balance); // ...
} Now, we need a function to calculate a tree node hash: fn merkle_node_hash(left: Sha256Digest, right: Sha256Digest) -> Sha256Digest { let mut data = [false; 512]; // [bool; 512] // Casting to u16 is needed to make the range types equal, // since 0 will be inferred as u8, and 256 - as u16. for i in 0 as u16..256 { data[i] = left[i]; data[256 + i] = right[i]; } std::crypto::sha256(data) // [bool; 256] a.k.a. Sha256Digest
} The Zinc standard library does not support array concatenation yet, so, for now, we will do it by hand, allocating an array to contain two leaf node digests, then put the digests together and hash them with std::crypto::sha256. Finally, let's define a function to calculate the hash of the whole tree: fn restore_root_hash( leaf_hash: Sha256Digest, address: [bool; 10], merkle_path: [Sha256Digest; 10],
) -> Sha256Digest
{ let mut current = leaf_hash; // Sha256Digest // Traverse the tree from the left node to the root node for i in 0..10 { // Multiple variables binding is not supported yet, // so we going to store leaves as an array of two digests. // If address[i] is 0, we are in the left node, otherwise, // we are in the right node. let left_and_right = if address[i] { [current, merkle_path[i]] // [Sha256Digest; 2] } else { [merkle_path[i], current] // [Sha256Digest; 2] }; // remember the current node hash current = merkle_node_hash(left_and_right[0], left_and_right[1]); } // return the root node hash current
} Congratulations! Now we have a working circuit able to verify the Merkle proof! // main.zn type Sha256Digest = [bool; 256]; fn balance_hash(balance: field) -> Sha256Digest { let bits = std::convert::to_bits(balance); // [bool; 254] let bits_padded = std::array::pad(bits, 256, false); // [bool; 256] std::crypto::sha256(bits_padded) // [bool; 256] a.k.a. Sha256Digest
} fn merkle_node_hash(left: Sha256Digest, right: Sha256Digest) -> Sha256Digest { let mut data = [false; 512]; // [bool; 512] // Casting to u16 is needed to make the range types equal, // since 0 will be inferred as u8, and 256 - as u16. for i in 0 as u16..256 { data[i] = left[i]; data[256 + i] = right[i]; } std::crypto::sha256(data) // [bool; 256] a.k.a. Sha256Digest
} fn restore_root_hash( leaf_hash: Sha256Digest, address: [bool; 10], merkle_path: [Sha256Digest; 10],
) -> Sha256Digest
{ let mut current = leaf_hash; // Sha256Digest // Traverse the tree from the left node to the root node for i in 0..10 { // Multiple variables binding is not supported yet, // so we going to store leaves as an array of two digests. // If address[i] is 0, we are in the left node, otherwise, // we are in the right node. let left_and_right = if address[i] { [current, merkle_path[i]] // [Sha256Digest; 2] } else { [merkle_path[i], current] // [Sha256Digest; 2] }; // remember the current node hash current = merkle_node_hash(left_and_right[0], left_and_right[1]); } // return the root node hash current
} struct PublicInput { root_hash: Sha256Digest,
} fn main( address: [bool; 10], balance: field, merkle_path: [Sha256Digest; 10]
) -> PublicInput { let leaf_hash = balance_hash(balance); let root_hash = restore_root_hash( leaf_hash, address, merkle_path, ); struct PublicInput { root_hash: root_hash, }
}

