} Perfect! Now all our functions and types are defined. By the way, let's have a glance at our merkle module, where you can find another improvement! use std::crypto::sha256; // an import type Sha256Digest = [bool; 256]; fn balance_hash(balance: field) -> Sha256Digest { let bits = std::convert::to_bits(balance); let bits_padded = std::array::pad(bits, 256, false); sha256(bits_padded)
